import { background } from 'native-base/lib/typescript/theme/styled-system';
import React from 'react';
import { View, Image, Text, StyleSheet } from 'react-native';

const HomePageBox_Two = () => {
    return (
        <View style={styles.box_two}>
            <View style={styles.box_two_heading}>
                <Text style={styles.box_two_Style}>Our Staf</Text>
                <Text style={styles.box_two_btn_btnStyle}>Show All</Text>
            </View>
        
        </View>
    );
}

const styles = StyleSheet.create({
    box_two: {
        marginTop: '10%',
        height:'50px',
        width:'100%',
        backgroundColor:"#808090"
    },
    box_two_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    box_two_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two_btn_btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
})

export default HomePageBox_Two;
